                <p>This is a Bootstrap modal in React!</p>
                <p>This is a Bootstrap modal in React!</p>
                <p>This is a Bootstrap modal in React!</p>
              </div>
              <div className="modal-footer">
                <button
                  type="button"
                  className="btn btn-secondary"
                  onClick={handleClosePopup}
                >
                  Close
                </button>
              </div>
            </div>
          </div>
        </div>
      )}
    </div>
  );
}


